                if(($(window).height() > $('.modal_form').outerHeight() + 100) && this.param.fixed)
                        $('.modal_form').css({'top': (($(window).height() - $('.modal_form').outerHeight()) / 2 - 50) + 'px', 'marginTop': '0', 'position': 'fixed'});
